// Get a reference to the data container table
var table = document.getElementById('dataContainer');

// Split the data into lines
var lines = data.split('\n');

// Iterate over each line and create table rows
for (var i = 0; i < lines.length; i++) {
    var line = lines[i].trim();

    // Skip empty lines
    if (line === '') continue;

    // Split the line into columns
    var columns = line.split(/\s+/);

    // Create a new table row
    var row = document.createElement('tr');

    // Create table cells and populate them with column values
    for (var j = 0; j < columns.length; j++) {
        var cell = document.createElement('td');
        cell.textContent = columns[j];
        row.appendChild(cell);
    }

    // Append the row to the table
    table.appendChild(row);
}
